import React from 'react'

function CartItem({id, name, price, qty}) {
    return(
        <div className = "Cart">
            <div>{name}</div>
            <div>${price}</div>
            <div>
                <button>-</button>
                {qty}
                <button>-</button>
            </div>
            <div>Total: ${qty*price}</div>
        </div>
    );

}

export default CartItem;
